import React from "react";

const Contact = () =>{
    return(
        <>
            <div className="container">
                <div className="row">
                    <div className="col-md-4 mx-auto">
                        <form>
                            <input type="text" class="form-control"/>
                        </form>
                    </div>
                </div>
            </div>

        </>
    );
}


export default Contact;
